import http from "../http-common";

class UserManagementDataService {
  getAll() {
    return http.get("/user-management");
  }

  get(id) {
    return http.get(`/user-management/${id}`);
  }

  create(data) {
    return http.post("/user-management", data);
  }

  update(id, data) {
    return http.put(`/user-management/${id}`, data);
  }

  delete(id) {
    return http.delete(`/user-management/${id}`);
  }

  deleteAll() {
    return http.delete(`/user-management`);
  }

  findByTitle(title) {
    return http.get(`/user-management?title=${title}`);
  }
}

export default new UserManagementDataService();
